import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the login form
    await page.waitForSelector('#email');
    await page.fill('#email', 'your_email@example.com'); // Replace with actual email

    await page.waitForSelector('#password');
    await page.fill('#password', 'your_password'); // Replace with actual password

    // Click the login button
    await page.waitForSelector('button.login-btn');
    await page.click('button.login-btn');

    // Wait for navigation after login
    await page.waitForLoadState('networkidle');

    // Take a screenshot after login
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Extract meaningful data to verify task completion
    const userName = await page.textContent('selector_for_user_name'); // Replace with actual selector for user name
    const extractedData = { userName };

    return {
      success: true,
      action: "Logged in and extracted user name",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

