    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Extract meaningful data to verify task completion
    const loggedInUser = await page.evaluate(() => {
      return document.querySelector('div.user-info') ? document.querySelector('div.user-info').textContent : null;
    });

    return {
      success: true,
      action: "Successfully logged in and verified user information",
      extractedData: { loggedInUser },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
